const initialState = [
    {
        title: "Prvi",
        id: 0,
        cards: [
            {
                id: 0,
                text: "tle je tekst"
            },
            {
                id: 1,
                text: "tle je tekst2"
            }
        ]
    }
]

const listReducer = (state = initialState, action) => {
    switch (action.type){
        default:
            return state;
    }
}

export default listReducer;
